import './App.css';

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
function Home(){
  return<div>Home</div>;
}

function About(){
  return<div>About</div>;
}
function App() {
  return (
    <Router>
      <div class="App.js">
        <Link to="/communities">community</Link>
        <Link to="/resume-builder">resume builder</Link>
        <Link to="/resources">resources</Link>
      </div>
      <Switch>

        <Route path="/communities-project-collaboration"></Route>
        <Route path="/resume-builder"></Route>
        <Route path="/resources"></Route>
      </Switch>
    </Router>
  );
}

export default App;
